import axios from "axios";

export default {
    state: {
        addContest: "",
        contestIdData: "",
    },
    getters: {
        getAddContest: (state) => {
            return state.addContest
        },
        getContestIdData: (state) => {
            return state.contestIdData
        }
    },
    mutations: {
        setAddContest: (state, value) => {
            state.addContest = value;
        },
        setContestIdData: (state, value) => {
            state.contestIdData = value
        }
    },
    actions: {
        async ADD_CONTEST({commit}, {payload}) {
            const response = await axios.post("/api/QuizMaster/addContest", payload);
            console.log(response.data)
            commit('setAddContest', response.data)
        },
        async GET_CONTEST_BY_ID({commit}, id) {
            // /contest/getContestById/{id}
            const response = await axios.get("/api/contest/getContestById"+id);
            commit('set')
        }
    },
}
